import "./Header.scss";

import Logo from './Logo/Logo';
import Navegation from './Navegation/Navegation';

import carrito from "./../../img/carrito.png";
import hacker from "./../../img/hacker.png";
import technical from "./../../img/technical.png";

function Header() {
  return (
    <header className="header">
        <Logo />

        <Navegation />

        <form action="#" className="header-search">
            <input type="text" className="header-search__input"></input>
            <button className="header-search__button">B</button>
        </form>

        <div className="header-icon">
            <div className="header-icon__technical">
                <img src={technical}></img>
            </div>
            <div className="header-icon__cesta">
                <img src={carrito}></img>
            </div>
            <div className="header-icon__user">
                <img src={hacker}></img>
            </div>
        </div>

    </header>
  );
}

export default Header;
